class Solution:
    def maxOperations(self, s: str) -> int:
        ans = 0
        p = 0
        has_one = False
        for char in s:
            if char == '1':
                p += 1
                has_one = True
            elif char == '0' and has_one:
                ans += p
                has_one = False
        return ans
